import "./Header.css";

const Header = () => {
  return (
    <div className="header">
      <ul className="nav-tabs">
        <li className="active">About</li>
        <li>Resume</li>
        <li>Portfolio</li>
        <li>Contact</li>
      </ul>
    </div>
  );
};

export default Header;
